import React from "react";
import Admin from "react-crud-admin";
import Form from "react-jsonschema-form";
import axios from "axios";

import "react-crud-admin/css"; //optional css import

export default class Example extends Admin {
  constructor() {
    super();
    this.name = "Tenant";
    this.name_plural = "Tenants";
    this.list_display_links = ["name"];
    this.list_display = ["name","code","emailId", "districtName"];
  
    this.pages_in_pagination = 20;
    
  }

  get_queryset(page_number, list_per_page, queryset) {
    axios.get("/list").then(response => {
  
        
        this.set_queryset(response.data);
      
    });

  return queryset;
   

  }
  
  get_form(object = null) {
    let schema ={
      "$schema": "http://json-schema.org/schema#",
      "type": "object",
      "properties": {
        "tenantId": {
          "type": "string",
          "default":"pb"
        },
        "moduleName": {
          "type": "string",
          "default":"tenant"
        },
        "tenants": {
          "type": "array",
          "items": {
            "type": "object",
            "properties": {
              "code": {
                "type": "string"
              },
              "name": {
                "type": "string"
              },
              "description": {
                "type": "string"
              },
              "logoId": {
                "type": "string"
              },
              "imageId": {
                "type": "null"
              },
              "domainUrl": {
                "type": "string"
              },
              "type": {
                "type": "string"
              },
              "twitterUrl": {
                "type": "null"
              },
              "facebookUrl": {
                "type": "null"
              },
              "emailId": {
                "type": "string"
              },
              "OfficeTimings": {
                "type": "object",
                "properties": {
                  "Mon - Fri": {
                    "type": "string"
                  }
                },
                "required": [
                  "Mon - Fri"
                ]
              },
              "city": {
                "type": "object",
                "properties": {
                  "name": {
                    "type": "string"
                  },
                  "localName": {
                    "type": "string"
                  },
                  "districtCode": {
                    "type": "string"
                  },
                  "districtName": {
                    "type": "string"
                  },
                  "districtTenantCode": {
                    "type": "string"
                  },
                  "regionName": {
                    "type": "string"
                  },
                  "ulbGrade": {
                    "type": "string"
                  },
                  "longitude": {
                    "type": "number"
                  },
                  "latitude": {
                    "type": "number"
                  },
                  "shapeFileLocation": {
                    "type": "null"
                  },
                  "captcha": {
                    "type": "null"
                  },
                  "code": {
                    "type": "string"
                  },
                  "regionCode": {
                    "type": "string"
                  },
                  "municipalityName": {
                    "type": "string"
                  },
                  "ddrName": {
                    "type": "string"
                  }
                },
                "required": [
                  "captcha",
                  "code",
                  "ddrName",
                  "districtCode",
                  "districtName",
                  "districtTenantCode",
                  "latitude",
                  "localName",
                  "longitude",
                  "municipalityName",
                  "name",
                  "regionCode",
                  "regionName",
                  "shapeFileLocation",
                  "ulbGrade"
                ]
              },
              "address": {
                "type": "string"
              },
              "contactNumber": {
                "type": "string"
              }
            },
            "required": [
              "OfficeTimings",
              "address",
              "city",
              "code",
              "contactNumber",
              "description",
              "domainUrl",
              "emailId",
              "facebookUrl",
              "imageId",
              "logoId",
              "name",
              "twitterUrl",
              "type"
            ]
          }
        }
      },
      "required": [
        "moduleName",
        "tenantId",
        "tenants"
      ]
    };

    if (!object) {
      return <Form schema={schema} />;
    } else {
      return <Form schema={schema} formData={object} />;
    }
  }
}
